import React from 'react';
import Topbar from './Topbar';
import Menu from './Menu';
import Banner from './Banner';
import Frame69 from './Frame69';

function App() {
  return (
    <div>
      <Topbar />
      <Menu />
      <Banner />
      <Frame69 />
      {/* Other homepage sections will go here */}
    </div>
  );
}

export default App;
